import { useEffect } from "react";
import { useLoaderData } from "react-router-dom";

import EventsList from "../components/EventsList";

function EventsPage() {
  useEffect(() => {
    async function fetchEvents() {
      setIsLoading(true);
      setIsLoading(false);
    }

    fetchEvents();
  }, []);
  return (
    <EventList events={fetchedEvents} />
  );
}

export default EventsPage;
